function getPlotlyBoxValuesForAll(tsc) {
    var datum = [];
    // All data
    for (var k = 0; k < tsc.length; k++) {
        datum.push(tsc[k][1]);
    }
    return datum;
}

function getPlotlyBoxValuesForPeriodAvg(tsc, periodMonths) {
    var datum = [];
    for (var i = 0; i < tsc.length; i += periodMonths.length) {
        var sum = 0;
        for (var j = 0; j < periodMonths.length && i + periodMonths.length < tsc.length; j++) {
            sum += tsc[i + j][1];
        }
        datum.push(sum / periodMonths.length);
    }
    return datum;
}

function getPlotlyBoxValues(dataOnly, periodMonths) {
    var y = [];
    var x = [];
    if (periodMonths.length > 1) {
        let values = getPlotlyBoxValuesForAll(dataOnly);
        y = y.concat(values);
        x = x.concat(new Array(values.length).fill('All', 0, values.length));
    }
    for (var i = 0; i < periodMonths.length; i++) {
        let filteredData = filterDataForMonth(dataOnly, periodMonths[i]);
        y = y.concat(filteredData);
        x = x.concat(new Array(filteredData.length).fill(periodMonths[i], 0, filteredData.length));
    }
    if (periodMonths.length > 1) {
        let values = getPlotlyBoxValuesForPeriodAvg(dataOnly, periodMonths);
        y = y.concat(values);
        x = x.concat(new Array(values.length).fill('Annual', 0, values.length));
    }
    return {
        y: y,
        x: x,
    };
}

function filterDataForMonth(data, month) {
    var retval = [];
    for (var i = 0; i < data.length; i++) {
        let dateMillis = data[i][0];
        var tsDate = new Date(dateMillis);
        var compareMonth = new Date(Date.parse(month + "1, 2012"));
        let monthNum = compareMonth.getMonth() - 1;
        if(monthNum < 0)
        {
            monthNum += 11;
        }
        if (monthNum === tsDate.getMonth()) {
            retval.push(data[i][1]);
        }
    }
    return retval;
}

function getPlotlySeries(datum, periodMonths) {
    var series = [];
    for (var i = 0; i < datum.length; i++) {
        var timeSeries = datum[i]['period_filtered_time_series'];
        var data = getPlotlyBoxValues(timeSeries, periodMonths);
        series.push({
            y: data['y'],
            x: data['x'],
            type: 'box',
            name: datum[i]['scenario_name'],
            marker: {
                color: datum[i]['scenario_color']
            },
            boxmean: 'sd'
        });
    }
    return series;
}

function getUnits(data) {
    var units;
    if (data['taf']) {
        units = 'TAF';
    } else {
        units = 'CFS';
    }
    return units;
}


function plot(data) {
    var units = getUnits(data);
    let datum = data['scenario_run_data'];
    let periodMonths = data['period_months'];
    var layout = {
        font: {
            family: 'Lucida Grande", "Lucida Sans Unicode", "Verdana", "Arial", "Helvetica", "sans-serif',
            color: 'black',
        },
        legend: {
            orientation: 'h',
            xanchor: 'center',
            x: 0.5,
            font: {
                size: 10,
            }
        },
        yaxis: {
            title: 'Volume (CFS)',
            automargin: true,
            zeroline: false
        },
        xaxis: {
            automargin: true
        },
        boxmode: 'group'
    };
    Plotly.newPlot('container2', getPlotlySeries(datum, periodMonths), layout, {
            displaylogo: false,
            modeBarButtonsToRemove: ['toImage', 'sendDataToCloud', 'editInChartStudio', 'lasso2d', 'select2d', 'resetScale2d'],
            scrollZoom: true,
            responsive: true
        }
    );
}
